		deleted: false,
		active: true,
		explanation:
			'<p>dysphagia:A condition with difficulty in swallowing food or liquid. This may interfere in a person’s ability to eat and drink, Primary progressive aphasia (PPA) is a neurodegenerative disease of insidious onset presenting with progressive isolated loss of language function, without significant impairment in other cognitive domains, </p><p><br></p><p>Apraxia :A neurological syndrome characterised by difficulty in performing daily tasks even if the instructions are understood. The person affected finds it difficult to tie shoelace, button the shirt, difficulty in making certain facial expressions etc</p><p><br></p><p><span style="color: rgb(32, 33, 36);">Aphasia is&nbsp;</span><strong style="color: rgb(32, 33, 36);">when a person has difficulty with their language or speech</strong><span style="color: rgb(32, 33, 36);">. It\'s usually caused by damage to the left side of the brain (for example, after a stroke).</span></p>',
