		question:
			"<p>A patient in your care knocks their head on the bedside locker when reaching down to pick up something they have dropped. What do you do?</p>",
		subject: ["6273f43aff0c09aa47c2f73c"],
		subClass: [],
		microClass: [],
		nanoClass: [],
		typeOfQuestion: "RADIO",
		correctAnswer: [
			{
				title:
					"<p>Help the patient to a safe comfortable position, take a set of observations and report the incident to the nurse in charge who may call a doctor. Complete an incident form. At an appropriate time, discuss the incident with the patient and, if they wish, their relatives.</p>",
				value: "d",
				_id: {
					$oid: "622d8ef4d36221fa2002b26c",
				},
			},
		],
