		question:
			"<p>What steps would you take if you had sustained a needlestick injury?</p>",
		qId: "QID-000283",
		subject: ["627141c8b61335338032b75e"],
		subClass: [],
		microClass: [],
		nanoClass: [],
		typeOfQuestion: "RADIO",
		correctAnswer: [
			{
				title:
					"<p>Gently make the wound bleed, place under running water and wash thoroughly with soap and water. Complete an incident form and inform your manager. Co- operate with any action to test yourself or the patient for infection with a bloodborne virus but do not obtain blood or consent for testing from the patient yourself; this should be done by someone not involved in the incident.</p>",
				value: "b",
				_id: {
					$oid: "62320039a58b13fb3bdd963e",
				},
			},
		],
		createdBy: "621b1add1ac92818c13cfc59",
		status: "Needs Review",
		options: [
			{
				title:
					"<p>Ask for advice from the emergency department, report to occupational health and fill in an incident form.</p>",
				value: "a",
				_id: {
					$oid: "62320039a58b13fb3bdd963f",
				},
			},
			{
				title:
					"<p>Gently make the wound bleed, place under running water and wash thoroughly with soap and water. Complete an incident form and inform your manager. Co- operate with any action to test yourself or the patient for infection with a bloodborne virus but do not obtain blood or consent for testing from the patient yourself; this should be done by someone not involved in the incident.</p>",
				value: "b",
				_id: {
					$oid: "62320039a58b13fb3bdd9640",
				},
			},
			{
				title:
					"<p>Take blood from patient and self for Hep B screening and take samples and form to Bacteriology. Call your union representative for support. Make an appointment with your GP for a sickness certificate to take time off until the wound site has healed so you don't contaminate any other patients.</p>",
				value: "c",
				_id: {
					$oid: "62320039a58b13fb3bdd9641",
				},
			},
			{
				title:
					"<p>Wash the wound with soap and water. Cover any wound with a waterproof dressing to prevent entry of any other foreign material</p>",
				value: "d",
				_id: {
					$oid: "62320039a58b13fb3bdd9642",
				},
			},
		],
