		question:
			"<p>Why is it essential to humidify oxygen used during respiratory therapy?</p>",
		qId: "QID-000292",
		subject: ["6273bf179e3e8c57e20739d9"],
		subClass: [],
		microClass: [],
		nanoClass: [],
		typeOfQuestion: "RADIO",
		correctAnswer: [
			{
				title:
					"<p>Oxygen is a dry gas which can cause evaporation of water from the respiratory tract and lead to thickened mucus in the airways, reduction of the movement of cilia and increased susceptibility to respiratory infection.&nbsp;&nbsp;</p>",
				value: "b",
				_id: {
					$oid: "6232030ea58b13fb3bddc692",
				},
			},
		],
		createdBy: "621b1add1ac92818c13cfc59",
		status: "Needs Review",
		options: [
			{
				title:
					"<p>Oxygen is a very hot gas so if humidification isn't used, the oxygen will burn the respiratory tract and cause considerable pain for the patient when they breathe.&nbsp;&nbsp;</p>",
				value: "a",
				_id: {
					$oid: "6232030ea58b13fb3bddc693",
				},
			},
			{
				title:
					"<p>Oxygen is a dry gas which can cause evaporation of water from the respiratory tract and lead to thickened mucus in the airways, reduction of the movement of cilia and increased susceptibility to respiratory infection.&nbsp;&nbsp;</p>",
				value: "b",
				_id: {
					$oid: "6232030ea58b13fb3bddc694",
				},
			},
			{
				title:
					'<p><span style="color: rgb(51, 62, 72);">Humidification cleans the oxygen as it is administered to ensure it is free from any aerobic pathogens before it is inhaled by the patient.</span></p>',
				value: "c",
				_id: {
					$oid: "6232030ea58b13fb3bddc695",
				},
			},
		],
