		question:
			"<p>You are caring for a patient in isolation with suspected Clostridium difficile. What are the essential key actions to prevent the spread of infection?</p>",
		qId: "QID-000282",
		subject: ["627141c8b61335338032b75e"],
		subClass: ["6273f71799e3878a8f5ca227"],
		microClass: [],
		nanoClass: [],
		typeOfQuestion: "RADIO",
		correctAnswer: [
			{
				title:
					"<p>Provide the patient and family with adequate information.</p>",
				value: "F",
				_id: {
					$oid: "6231ffd8a58b13fb3bdd90f6",
				},
			},
		],
		createdBy: "621b1add1ac92818c13cfc59",
		status: "Needs Review",
		options: [
			{
				title:
					"<p>Regular hand hygiene and the promotion of the infection prevention link nurseRole.&nbsp;Encourage the doctors to wear gloves and aprons, to be bare below the elbow and to wash hands with alcohol hand rub.</p>",
				value: "a",
				_id: {
					$oid: "6231ffd8a58b13fb3bdd90f7",
				},
			},
			{
				title:
					"<p>Ask for cleaning to be increased with soap-based products.</p>",
				value: "b",
				_id: {
					$oid: "6231ffd8a58b13fb3bdd90f8",
				},
			},
			{
				title:
					"<p>Ask the infection prevention team to review the patient's medication chart and provide regular teaching sessions on the 5 moments of hand hygiene.&nbsp;</p>",
				value: "c",
				_id: {
					$oid: "6231ffd8a58b13fb3bdd90f9",
				},
			},
			{
				title:
					"<p>Provide the patient and family with adequate information.</p>",
				value: "d",
				_id: {
					$oid: "6231ffd8a58b13fb3bdd90fa",
				},
			},
			{
				title:
					"<p>Review antimicrobials daily, wash hands with soap and water before and after each contact with the patient, ask for enhanced cleaning with chlorine-based products and use gloves and aprons when disposing of body fluids.</p>",
				value: "e",
				_id: {
					$oid: "6231ffd8a58b13fb3bdd90fb",
				},
			},
			{
				title: "<p>All of the above</p>",
				value: "f",
				_id: {
					$oid: "6231ffd8a58b13fb3bdd90fc",
				},
			},
		],
