		question:
			"<p>What is the difference between denial and collusion?&nbsp;</p>",
		qId: "QID-000396",
		subject: ["627141c8b61335338032b75e"],
		subClass: [],
		microClass: [],
		nanoClass: [],
		typeOfQuestion: "RADIO",
		correctAnswer: [
			{
				title:
					"<p>Denial is a coping mechanism used by an individual with the intention of protecting themselves from painful or distressing information whereas collusion is the withholding of information from the patient with the intention of ‘protecting them’.</p>",
				value: "c",
				_id: {
					$oid: "623235d1c812eb6649f49563",
				},
			},
		],
		createdBy: "621b1add1ac92818c13cfc59",
		status: "InComplete",
		options: [
			{
				title:
					"<p>Denial is when a healthcare professional refuses to tell a patient their diagnosis for the protection of the patient whereas collusion is when healthcare professionals and the patient agree on the information to be told to relatives and friends.&nbsp;</p>",
				value: "a",
				_id: {
					$oid: "623235d1c812eb6649f49564",
				},
			},
			{
				title:
					"<p>Denial is when a patient refuses treatment and collusion is when a patient agrees to it.&nbsp;</p>",
				value: "b",
				_id: {
					$oid: "623235d1c812eb6649f49565",
				},
			},
			{
				title:
					"<p>Denial is a coping mechanism used by an individual with the intention of protecting themselves from painful or distressing information whereas collusion is the withholding of information from the patient with the intention of ‘protecting them’.</p>",
				value: "c",
				_id: {
					$oid: "623235d1c812eb6649f49566",
				},
			},
		],
